import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';
import { getContestProblems } from '../services/api';
// import './styles/SolveContest.css';

const SolveContest = () => {
  const { contestId } = useParams();
  const [problems, setProblems] = useState([]);
  const [error, setError] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    // Fetch problems for the contest
    getContestProblems(contestId)
      .then((response) => {
        if (response.data?.contest_problem) {
          setProblems(response.data.contest_problem);
        } else {
          setError('No problems found for this contest.');
        }
      })
      .catch(() => setError('Failed to load contest problems.'))
      .finally(() => setLoading(false));
  }, [contestId]);

  return (
    <div className="solve-contest-container">
      <h2>Contest Problems</h2>
      {loading ? (
        <p>Loading contest problems...</p>
      ) : error ? (
        <p className="error-message">{error}</p>
      ) : problems.length === 0 ? (
        <p>No problems found for this contest.</p>
      ) : (
        <div className="problems-list">
          {problems.map((problem) => (
            <div key={problem.id} className="problem-card">
              <h3>{problem.title}</h3>
              <p>{problem.description}</p>
              <p>
                <strong>Points:</strong> {problem.points}
              </p>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default SolveContest;
